ation&quot;:4386,&quot;state&quot;:&quot;passed&quot;,&quot;speed&quot;:&quot;fast&quot;,&quot;pass&quot;:true,&quot;fail&quot;:false,&quot;pending&quot;:false,&quot;context&quot;:null,&quot;code&quot;:&quot;let sum = 0;\nlet totalAmount = 0;\n// Get the total amount from the .totalAmount element\ncy.get(&#x27;.totalAmount&#x27;).invoke(&#x27;text&#x27;).then(text =&gt; {\n  // Extract the number from the text\n  totalAmount = parseInt(text.trim().replace(&#x27;Total Amount Collected:&#x27;, &#x27;&#x27;).trim(), 10);\n});\n// Get all the rows inside the scrollable table and sum the last column\ncy.get(&#x27;.tableFixHead &gt; table &gt; tbody &gt; tr &gt; td:last-child&#x27;).then($cells =&gt; {\n  const values = [];\n  $cells.each((index, cell) =&gt; {\n    // Get the text content of the cell\n    const text = Cypress.$(cell).text().trim();\n    values.push(text);\n  });\n  // Convert the text values to integers and sum them\n  values.forEach(text =&gt; {\n    const value = parseInt(text, 10);\n    if (!isNaN(value)) {\n      sum += value;\n    }\n  });\n  // Log the sum of the last column\n  cy.log(`Sum of the last column: ${sum}`);\n  // Assert the sum is equal to the total amount\n  expect(sum).to.equal(totalAmount);\n});&quot;,&quot;err&quot;:{},&quot;uuid&quot;:&quot;12f73f51-ed52-4987-859b-a9a3a4a800d2&quot;,&quot;parentUUID&quot;:&quot;ad36751e-9757-4d56-94c2-5b81596ca982&quot;,&quot;isHook&quot;:false,&quot;skipped&quot;:false},{&quot;title&quot;:&quot;Click all the table rows with Cypress&quot;,&quot;fullTitle&quot;:&quot;exercise Click all the table rows with Cypress&quot;,&quot;timedOut&quot;:null,&quot;duration&quot;:2057,&quot;state&quot;:&quot;passed&quot;,&quot;speed&quot;:&quot;fast&quot;,&quot;pass&quot;:true,&quot;fail&quot;:false,&quot;pending&quot;:false,&quot;context&quot;:null,&quot;code&quot;:&quot;cy.get(&#x27;.tableFixHead &gt; table &gt; tbody &gt; tr&#x27;).each($row =&gt; {\n  cy.wrap($row).click();\n});&quot;,&quot;err&quot;:{},&quot;u
